/**
 * Modal
 *
 * Implements http://twitter.github.com/bootstrap/javascript.html#modal
 *
 * bind()
 * create()
 * destroy()
 * getConfig()
 * getDefaults()
 * getElement()
 * hide()
 * show()
 * toggle()
 * update()
 *
 * @author: Carey Hinoki
 * @date: 1-18-2012
 * @version: 2
 * @updated 11-05-2012 Jbrownell
 */
(function ($) {
    PICS.define('widget.Modal', {
        methods: (function () {
            // default configuration
            var defaults = {
                modal_id: 'bootstrap_modal',
                modal_class: 'modal',
                modal_link_class: 'modal-link',

                backdrop: true,
                height: 'auto', // height of content area
                keyboard: true,
                show: false,
                width: 560, // width of modal

                title: 'TITLE',
                content: 'CONTENT',

                // button cofiguration: parameters include label, html, callback
                buttons: []
            };

            var modal;

            function getModal() {
                if (!modal) {
                    throw 'modal is undefined - initialize modal by using create()';
                }

                return modal;
            }

            function destroyModal() {
                modal = undefined;
            }

            return {
                bind: function (event, callback) {
                    if (typeof callback == 'function') {
                        var modal = getModal();

                        modal.bind(event, callback);
                    }
                },

                create: function (options) {
                    var config = {};

                    // generate config
                    $.extend(config, defaults, options);

                    function createModal() {
                        // update modal content
                        function updateModal(modal_header, modal_body) {
                            modal_header.find('h3').html(config.title);
                            modal_body.html(config.content);
                        }

                        function updateModalButtons(modal_footer) {
                            for (var i in config.buttons) {
                                if (config.buttons.hasOwnProperty(i) && typeof config.buttons[i] == 'object') {
                                    var button = config.buttons[i];

                                    if (button.label) {
                                        var label = button.label;
                                    } else {
                                        var label = 'Button';
                                    }

                                    if (button.html) {
                                        var btn = $(button.html)
                                    } else {
                                        var btn = $('<a href="javascript:;" class="btn">' + label + '</a>');
                                    }

                                    if (button.callback && typeof button.callback == 'function') {
                                        btn.bind('click', button.callback);
                                    }

                                    modal_footer.append(btn);
                                }
                            }
                        }

                        function updateModalPosition(modal, modal_body) {
                            // manually position modal
                            modal.css({
                                marginLeft: '-' + (config.width / 2) + 'px',
                                marginTop: '-' + ((config.height / 2) + 50) + 'px',
                                width: config.width
                            });

                            // configure height of modal content
                            modal_body.css({
                                height: config.height,
                                overflowY: 'auto'
                            });
                        }

                        // define modal element
                        var modal = $('<div id="' + config.modal_id + '" class="' + config.modal_class + '" style="display: none;">');

                        var modal_header = $('<div class="modal-header"><button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button><h3></h3></div>');
                        var modal_body = $('<div class="modal-body">');
                        var modal_footer = $('<div class="modal-footer">');

                        var html = modal.append(modal_header, modal_body, modal_footer);

                        $('body').append(html);

                        updateModal(modal_header, modal_body);

                        updateModalButtons(modal_footer);

                        updateModalPosition(modal, modal_body);

                        return modal;
                    }

                    // destroy existing modal if trying to create another modal
                    if (typeof modal !== 'undefined') {
                        this.destroy();
                    }

                    modal = createModal();

                    modal.modal(config);
                },

                destroy: function () {
                    var modal = getModal();

                    // remove modal and backdrop markup from dom
                    modal.remove();
                    $('.modal-backdrop').remove();

                    // reinitialize modal var
                    destroyModal();
                },

                getConfig: function () {
                    return config;
                },

                getDefaults: function () {
                    return defaults;
                },

                getElement: function () {
                    var modal = getModal();

                    return modal;
                },

                hide: function () {
                    var modal = getModal();

                    if (modal.is(':visible')) {
                        modal.modal('hide');
                    }
                },

                show: function () {
                    var modal = getModal();

                    if (!modal.is(':visible')) {
                        modal.modal('show');

                        // ie specific js to shim select menus
                        if ($.browser.msie && $.browser.version == 6) {
                            var offset = modal.offset();
                            var shim = $('<iframe class="shim" frameborder="0" scrolling="no"></iframe>');

                            // paste shim
                            shim.css({
                                'height': modal.height(),
                                'left': offset.left,
                                'position': 'absolute',
                                'top': offset.top,
                                'width': modal.width()
                            }).prependTo('body');

                            // add event to destroy shim after modal closes
                            modal.bind('hide', function () {
                                shim.remove();
                            });
                        }
                    }
                },

                toggle: function () {
                    var modal = getModal();

                    modal.modal('toggle');
                },

                update: function (config) {
                    var modal_element = getModal();

                    for (var prop in config) {
                        if (config.hasOwnProperty(prop)) {
                            if (prop === 'header') {
                                modal_element.find('.modal-header h3').html(config[prop]);
                            }
                            if (prop === 'body') {
                                modal_element.find('.modal-body').html(config[prop]);
                            }
                            if (prop === 'footer') {
                                modal_element.find('.modal-footer').html(config[prop]);
                            }
                        }
                    }
                }
            };
        }())
    });
})(jQuery);
(function ($) {
    PICS.define('widget.SessionTimer', {
        methods: function () {

            //default session times in seconds
            var session = {
                duration: 3600,
                notification_duration: 60,
                sessionActive: false
            };

            return {
                REDIRECTION_TARGET: 'Login.action',

                init: function () {
                    var that = this;

                    // any ajax made from the site that have an expired session will be forced to the redirection target
                    $(document).on('ajaxError', $.proxy(function (event, jqXHR, ajaxSettings, thrownError) {
                        if (jqXHR.status === 401) {
                            document.location = this.REDIRECTION_TARGET;
                        }
                    }, this));

                    // any ajax made from the site will restart the session timeout
                    $(document).on('ajaxSend', function (event, jqXHR, settings) {
                        if (that.getSessionActive()) {
                            PICS.debounce(that.initializeSessionTimeout(), 250);
                        }
                    });

                    this.getSessionDuration();
                },

                getSessionTimeoutNotification: function () {
                    PICS.ajax({
                        url: "SessionTimeout.action",
                        dataType: 'html',
                        success: function(data, textStatus, jqXHR) {
                            var notification_html = $.trim(data);

                            session.timeout_notification = $(notification_html);
                        }
                    });
                },

                getSessionActive: function () {
                    return this.sessionActive;
                },

                getSessionDuration: function () {
                    var that = this;

                    PICS.ajax({
                        url: "SessionAjax!getUserSession.action",
                        dataType: 'json',
                        success: function(data, textStatus, jqXHR) {
                            function isPageAnonymous() {
                                return data.error;
                            }

                            if (!isPageAnonymous()) {
                                that.setSessionDuration(data.sessionDuration);
                                that.setSessionActive(true);
                                that.initializeSessionTimeout();
                                that.getSessionTimeoutNotification();
                            }
                        }
                    });
                },

                initializeSessionTimeout: function () {
                    //overrides for testing in seconds
                    // session.duration = 15;
                    // session.notification_duration = 10;

                    //clear timers
                    clearTimeout(session.expiration_timer);
                    clearTimeout(session.notification_timer);

                    //remove notification
                    this.removeSessionTimeoutNotification();

                    //init remaining time
                    session.remaining_time = session.notification_duration;

                    this.startSessionTimeout();
                },

                logout: function () {
                    PICS.ajax({
                        url: "Login!sessionLogout.action",
                        dataType: 'json',
                        success: function(data, textStatus, jqXHR) {
                            if (data.referer) {
                                //redirect to referer to set "from" cookie
                                //to triggger redirect to previous page on login
                                document.location = data.referer;
                            } else {
                                this.REDIRECTION_TARGET + '?button=logout';
                            }
                        },
                        error: function(jqXHR, textStatus, errorThrown) {
                            this.REDIRECTION_TARGET + '?button=logout';
                        }
                    });
                },

                removeSessionTimeoutNotification: function () {
                    $('.session-timeout-notification').slideUp(400, function () {
                        $(this).remove();
                    });
                },

                // make an ajax request to restart session via ajaxSend() above to re-initialize session
                restartSessionTimeout: function (event) {
                    var that = this;

                    //remove global body click event
                    $('body').off('click');

                    //only restart session if time remaining
                    if (session.remaining_time > 0) {
                        PICS.ajax({
                            url: "SessionAjax!getUserSession.action"
                        });
                    } else {
                        that.logout();
                    }
                },

                setSessionDuration: function (duration) {
                    session.duration = duration;
                },

                setSessionActive: function (value) {
                    this.sessionActive = value;
                },

                showSessionTimeoutNotification: function () {
                    $(session.timeout_notification).prependTo('body');

                    $('.session-timeout-notification').slideDown();
                },

                startSessionTimeout: function () {
                    var that = this,
                        time_to_show_notification_millis = (session.duration - session.notification_duration) * 1000;

                    session.notification_timer = setTimeout(function() {
                        // show session timeout notification n-minutes before session expires
                        that.showSessionTimeoutNotification();

                        // start session expiration process (count down of n-minutes before being session expires)
                        that.expireSession();

                        //add on click event to body to trigger session restart
                        $('body').on('click', $.proxy(that.restartSessionTimeout, that));

                    }, time_to_show_notification_millis);
                },

                expireSession: function () {
                    if (session.remaining_time > 0) {
                        this.updateSessionTimeoutNotification(session.remaining_time);

                        session.remaining_time -= 1;

                        session.expiration_timer = setTimeout($.proxy(this.expireSession, this), 1000);
                    } else {
                        this.logout();
                    }
                },

                updateSessionTimeoutNotification: function (seconds) {
                    $('.session-timeout-notification').find('.time').html(seconds);
                }
            };
       }
    });
})(jQuery);
